package com.apisero;
import java.util.Stack;
public class stack {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Stack<Integer> abc = new Stack<Integer>();
		abc.add(4);
		abc.push(6);
		System.out.println(abc);
		abc.pop();
		System.out.println(abc);

	}

}
